import "./Style.css";
import {Link} from "react-router-dom"

function NavbarAdmin() {
  return (
    <nav className="navbar">
      <ul className="navbar-list">
        <a href="/admin/profiles">Perfis</a>
        <a href="/admin/create">
          <li className="">Cadastrar Perfil</li>
        </a>
        <a href="/admin/update">
          <li className="">Editar Perfil</li>
        </a>
        <a href="/admin/repo">
          <li className="">Repo</li>
        </a>
        <Link to="/">Sair</Link>
      </ul>
    </nav>
  );
}

export default NavbarAdmin;
